import { Link } from 'react-router-dom'

const Navbar = () => {

    return ( 
        <nav className="navbar">
           <Link to="/dnwaidnia"> <h1 style={{onH}}>Alex's Projects</h1></Link>
            <div className="links">
                <Link to="/">Home</Link>
                <Link to="/projects">Projects</Link>
                <Link to="/create">New Project</Link>
            </div>
        </nav>



     );
}

export default Navbar;
